import React, { useState, useEffect, Component } from "react";
import MaterialTable from "material-table";
// import Container from "@material-ui/core/Container";
import TableContainer from "@material-ui/core/TableContainer";

import { makeStyles } from "@material-ui/core/styles";
import Paper from "@material-ui/core/Paper";
import Table from "@material-ui/core/Table";
import TableBody from "@material-ui/core/TableBody";
import TableCell from "@material-ui/core/TableCell";
// import TableContainer from "@material-ui/core/TableContainer";
import TableHead from "@material-ui/core/TableHead";
import TablePagination from "@material-ui/core/TablePagination";
import TableRow from "@material-ui/core/TableRow";
import Container from "@material-ui/core/Container";
import KeyboardArrowDownIcon from "@material-ui/icons/KeyboardArrowDown";
import KeyboardArrowUpIcon from "@material-ui/icons/KeyboardArrowUp";
import IconButton from "@material-ui/core/IconButton";
import Box from "@material-ui/core/Box";
import Collapse from "@material-ui/core/Collapse";
import Typography from "@material-ui/core/Typography";
import TextField from "@material-ui/core/TextField";

// import Paper from "@material-ui/core/Paper";
import InputBase from "@material-ui/core/InputBase";
import Divider from "@material-ui/core/Divider";
// import IconButton from "@material-ui/core/IconButton";
import MenuIcon from "@material-ui/icons/Menu";
import SearchIcon from "@material-ui/icons/Search";
import DirectionsIcon from "@material-ui/icons/Directions";

import { authAxios } from "../../utils";
import { orderListURL } from "../../constants";

function Test4() {
  const [orders, setOrders] = useState([]);
  const [loading, setLoading] = useState(false);

  const columns = [
    { label: "Shop Name", id: "shop_name" },
    { label: "Total Amount", id: "total" },
    { label: "Data", id: "start_date" },
    { label: "Status", id: "order_status" }
  ];

  useEffect(() => {
    const fetchOrders = async () => {
      setLoading(true);
      const res = await authAxios.get(orderListURL);
      setOrders(res.data);
      setLoading(false);
    };

    fetchOrders();
  }, []);

  return (
    <MaterialTable
      title="Multiple Detail Panels Preview"
      columns={[
        { title: "Name", field: "name" },
        { title: "Surname", field: "surname" },
        { title: "Birth Year", field: "birthYear", type: "numeric" },
        {
          title: "Birth Place",
          field: "birthCity",
          lookup: { 34: "İstanbul", 63: "Şanlıurfa" }
        }
      ]}
      data={[
        { name: "Mehmet", surname: "Baran", birthYear: 1987, birthCity: 63 },
        {
          name: "Zerya Betül",
          surname: "Baran",
          birthYear: 2017,
          birthCity: 34
        }
      ]}
      detailPanel={[
        {
          tooltip: "Show Name",
          render: rowData => {
            return (
              <div
                style={{
                  fontSize: 100,
                  textAlign: "center",
                  color: "white",
                  backgroundColor: "#43A047"
                }}
              >
                {rowData.name}
              </div>
            );
          }
        },
        {
          icon: "account_circle",
          tooltip: "Show Surname",
          render: rowData => {
            return (
              <div
                style={{
                  fontSize: 100,
                  textAlign: "center",
                  color: "white",
                  backgroundColor: "#E53935"
                }}
              >
                {rowData.surname}
              </div>
            );
          }
        },
        {
          icon: "favorite_border",
          openIcon: "favorite",
          tooltip: "Show Both",
          render: rowData => {
            return (
              <div
                style={{
                  fontSize: 100,
                  textAlign: "center",
                  color: "white",
                  backgroundColor: "#FDD835"
                }}
              >
                {rowData.name} {rowData.surname}
              </div>
            );
          }
        }
      ]}
    />
  );
}
export default Test4;
